rulesList.cssText:
@keyframes topbar_aitab_text_shine { 
  0% { background-position: 100% center; opacity: 0; }
  20% { opacity: 1; }
  80% { opacity: 1; }
  100% { background-position: 0px center; opacity: 0; }
}

@keyframes new_search_four_point_star_rotate { 
  0% { transform: rotate(0deg); }
  12% { transform: rotate(-20deg); }
  36% { transform: rotate(180deg); }
  100% { transform: rotate(0deg); }
}

@keyframes new_search_search_icon_rotate { 
  0% { transform: rotate(0deg); }
  10% { transform: rotate(-10deg); }
  40% { transform: rotate(25deg); }
  100% { transform: rotate(0deg); }
}

@keyframes new_search_arrow_right_icon_rotate { 
  0% { transform: translateX(0px); }
  16% { transform: translateX(2px); }
  26% { transform: translateX(0px); }
  36% { transform: translateX(-2px); }
  52% { transform: translateX(0px); }
  68% { transform: translateX(2px); }
  82% { transform: translateX(0px); }
  100% { transform: translateX(0px); }
}

@keyframes scroll-up_2czoY { 
  0% { transform: translateY(0px); }
  100% { transform: translateY(calc(-1 * var(--scroll-distance))); }
}

@keyframes rotateAndFade { 
  0% { opacity: 0; transform: translate(-50%, -50%) rotate(0deg); }
  20% { opacity: 1; transform: translate(-50%, -50%) rotate(120deg); }
  80% { opacity: 1; transform: translate(-50%, -50%) rotate(480deg); }
  100% { opacity: 0; transform: translate(-50%, -50%) rotate(600deg); }
}
